import json

def get_third_nested_element(json_obj):

    def traverse(obj):
        if isinstance(obj, list):
            for item in obj:
                yield from traverse(item)
        elif isinstance(obj, dict):
            for (key, value) in obj.items():
                yield from traverse(value)
        else:
            yield obj
    count = 1
    for element in traverse(json_obj):
        if count == 2:
            return element
        count += 1
    return None

